import * as aws from '@aws-sdk/client-ses';
import * as fs from 'fs';
import type { NextApiRequest, NextApiResponse } from 'next';
import { createTransport, SentMessageInfo } from 'nodemailer';
import nunjucks from 'nunjucks';
loadTemplates();

type Data = {
  name: string;
  email: string;
  body: string;
  emailResult?: SentMessageInfo;
};

type Response = string;

export default async function handler(
  req: NextApiRequest,
  res: NextApiResponse<Data | Response>
) {
  const aws_access_key_id = process.env.AWS_ACCESS_KEY_ECS;
  const aws_secret_access_key = process.env.AWS_SECRET_ACCESS_KEY_ECS;
  if (req.method === 'POST') {
    if (!req.body.name || !req.body.email || !req.body.message) {
      return res.status(400).json('Missing name, email, or message');
    }
    if (!process.env.BUS_EMAIL) {
      return res.status(500).json('BUS_EMAIL not set');
    }
    if (!process.env.STUDIO_AWS_ACCESS_KEY_ID) {
      return res.status(500).json('STUDIO_AWS_ACCESS_KEY_ID not set');
    }
    if (!process.env.STUDIO_AWS_SECRET_ACCESS_KEY) {
      return res.status(500).json('STUDIO_AWS_SECRET_ACCESS_KEY not set');
    }
    const ses = new aws.SES([
      {
        credentials: {
          accessKeyId: aws_access_key_id,
          secretAccessKey: aws_secret_access_key,
        },
        region: 'us-west-2',
      },
    ]);

    const transporter = createTransport({
      SES: { ses, aws },
    });

    const emailBody = nunjucks.renderString('/tmp/email.njk', {
      name: req.body.name,
      email: req.body.email,
      message: req.body.message,
      subject: req.body.subject,
    });

    try {
      const response = await transporter.sendMail({
        from: process.env.BUS_EMAIL,
        to: process.env.BUS_EMAIL,
        cc: [req.body.email],
        subject: `New message from ${req.body.name} via ${req.body.subject}`,
        html: emailBody,
      });
      return res.status(200).json({
        name: req.body.name,
        email: req.body.email,
        body: req.body.nessage,
        emailResult: response,
      });
    } catch (err) {
      return res
        .status(500)
        .json(JSON.stringify({ error: 'Error sending email' }));
    }
  }
  res.status(200).json('Hello there!');
}

